import Navbar from './components/Navbar';
import WeatherApp from './WeatherApp';

function App() {

  return (
    <>
      <header className="sticky top-0 max-w-full mx-auto z-50 xl:items-center">
        <Navbar />
      </header>
      <main>
        <div className='container flex justify-between items-center p-2 scroll-smooth overflow-scroll hover:scroll-auto'>
          <WeatherApp />
        </div>
      </main>
    </>

  );
}

export default App;
